import React from 'react';

function Maze() {
    const size = 20; // number of rows/columns

    return (
        <div>
            <div className="mazeBox">
                <h1>Maze Page</h1>
                <p>Enjoy the maze game!</p>
                <button className="startMaze">Generate Maze</button>
            </div>
        </div>
    );
}

export default Maze;
